export default class TaskItem extends React.Component {
  constructor(props, context) {
    super(props, context);
    this.state = {
      deleted: false
    };
  }

  render() {
    console.log("task item props:", this.props);

    return (
      <div>
        <li>{this.props.task}</li>
        <button className="delete"></button>
      </div>
    );
  }
}
